import React from 'react';
// import ReactPlayer from "react-player"

export default function video() {
  return (
    <div className="video-div">
      <video autoplay loop muted controls >
        <source src="../img/caliSkaters.mp4" type="video/mp4" />
      </video>
    </div>
  )
}
